import (
	context "context"
	fern "github.com/nullable-optional/fern"
	fernclient "github.com/nullable-optional/fern/client"
)

client := fernclient.NewClient()
response, err := client.NullableOptional.ListUsers(
	context.TODO(),
	&fern.ListUsersRequest{
		Limit: fern.Int(
			1,
		),
		Offset: fern.Int(
			1,
		),
		IncludeDeleted: fern.Bool(
			true,
		),
		SortBy: fern.String(
			"sortBy",
		),
	},
)

